import React from 'react'
import ReactDom from "react-dom"

class Test  extends React.Component{




    render() {
        return(<div><TableHead/><TableData/></div>)
    }

}

class TableData extends React.Component {


    constructor() {
        super();
        this.state = {
            data: [],

            setPreview: function (index, data) {
                this.data[index] = data;
            },

            getPreview: function () {
                return this.data;
            }
        };
        this.setStateHandle = this.setStateHandle.bind(this);

    }

     setStateHandle() {
         var menuItems=new Array({date:"Good",satan:"Hot"})
         for(var x  of menuItems){
              alert(x)
             this.state.setPreview(0,x)
         }

     }

     render() {
         return (<div><input type="text" id="text"/><input type="button" value="state" onClick={this.setStateHandle}/><div>{this.state.getPreview()[0]}</div></div>)
     }
}
TableData.defaultProps={

    tool:"Dagger",
    vehicle:"Amore"
}


class TableHead extends React.Component{

    render() {
        return(<div><tbody><tr><th>Head</th><th>Nose</th></tr></tbody></div>);
    }

}
class Heading extends React.Component{

    render() {
        return(<div>Movie Vegas</div>);
    }

}


export default TableData;
